import React, { } from 'react';
import GoogleMapReact from 'google-map-react'
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faPin } from "@fortawesome/free-solid-svg-icons";

const coords = {
    center : {
        lat: 50.7253757,
        lng: 2.5006967
    },
    zoom: 11
}

function Map() {
    return (
        <div style={{ height: '60vh', width: '100%' }}>
        <GoogleMapReact
            bootstrapURLKeys={{key: 'AIzaSyApmLUp7X8a-DlITCRKdG0kNYJSMqbQFiU'}}
            defaultCenter={coords.center}
            defaultZoom={coords.zoom}
        >
        <LocationPin
            lat={coords.center.lat}
            lng={coords.center.lng}
            text="Habidom"

        />


        </GoogleMapReact>
        </div>
    )
}

function LocationPin() {
    return (
        <div className="pin">


        </div>
    )

}

export default Map;
